import React, { Component } from 'react'

export default class Button extends Component {
  state = {
    clicked:false
  };
  butStyle = {
    fontWeight:0,
    fontFamily:"Comic Sans",
    backgroundColor:"beige",
    top:50
    
  };
  bodyStyle = {
    textAlign:"center",
    backgroundColor:"Black",
    color:"white"
  };
  spanStyle = {
    margin:25
  };
  render() {
    return (
      <div style={this.bodyStyle}>
        <h1>Welcome to the NBA Fantasy Ranking Calculator</h1>
        <div>
          <button className="btn btn-primary btn-sm">Official Fantasy Rules</button>
          <span style={this.spanStyle}></span>
          <button style={this.butStyle}>Custom Fantasy Rules</button>
        </div>
      </div>
    )
  }
}
